function setCharacterBlood(c_blood, color, bn, right)
{
	g=c_blood.graphics;
	g.clear();
	g.lineStyle(1,0x000000);
	g.beginFill(color, 1);
	for (var i = 0;i<bn;i++)
	{
		if (right)
		{
			var bx = i*10;
			g.moveTo(bx+-5,0);g.lineTo(bx+6,0);g.lineTo(bx+10,8);g.lineTo(bx+6,16);g.lineTo(bx+-5,16);g.lineTo(bx+0,8);g.lineTo(bx+-5,0);
		}else
		{
			var bx = 190-i*10;
			g.moveTo(bx+0,0);g.lineTo(bx+11,0);g.lineTo(bx+7,8);g.lineTo(bx+11,16);g.lineTo(bx+0,16);g.lineTo(bx-4,8);g.lineTo(bx+0,0);
		}
	}
	g.endFill();
	g.beginFill(0xff0000, 1);
	for (var i = bn;i<20;i++)
	{
		if (right)
		{
			var bx = i*10;
			g.moveTo(bx+-5,0);g.lineTo(bx+6,0);g.lineTo(bx+10,8);g.lineTo(bx+6,16);g.lineTo(bx+-5,16);g.lineTo(bx+0,8);g.lineTo(bx+-5,0);
		}else
		{
			var bx = (i-bn)*10;
			g.moveTo(bx+0,0);g.lineTo(bx+11,0);g.lineTo(bx+7,8);g.lineTo(bx+11,16);g.lineTo(bx+0,16);g.lineTo(bx-4,8);g.lineTo(bx+0,0);
		}
	}
	g.endFill();
}
